import React, { Component } from 'react';

class ChangeItem extends Component{
    constructor(props){
        super(props);
    }

    render(){
        const item=this.props.item
        if(item){
            return <button >make it false</button>
        }else{
            return <button >make it true</button>
        }
    }

}

export default ChangeItem;
